<?php

use Illuminate\Database\Seeder;


class MatteTemplateSeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        $matteTemplates=[
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,'
        ];

        foreach ($matteTemplates as $mt){
            factory(App\MatteTemplate::class, 1) ->create()->each(function ($m) use ($mt)  {
                $m->thumbnail=$mt;
                $m->save();
            });
        }
    }
}
